    StrBuilder sb = new StrBuilder();
    sb.setNullText("NULL").append((StringBuffer) null);
    assertEquals("NULL", sb.toString());

    sb = new StrBuilder();
    sb.append(new StringBuffer("foo"));
    assertEquals("foo", sb.toString());

